import BinaryBitmap from '@zxing/library/cjs/core/BinaryBitmap';
import DecodeHintType from '@zxing/library/cjs/core/DecodeHintType';
import Result from '@zxing/library/cjs/core/Result';
/**
 * Implementation of this interface attempt to read several barcodes from one image.
 *
 * @see com.google.zxing.Reader
 * @author Sean Owen
 */
export default interface MultipleBarcodeReader {
    /**
     * @throws NotFoundException
     */
    decodeMultiple(image: BinaryBitmap): Result[];
    /**
     * @throws NotFoundException
     */
    decodeMultiple(image: BinaryBitmap, hints: Map<DecodeHintType, any>): Result[];
}
